import React from "react";
import { MDBContainer, MDBRow, MDBCol, MDBJumbotron, MDBIcon } from "mdbreact";
import MenuLink from "./../components/menuLink";

const ComponentsNavPage = () => {
  return (
    <MDBContainer>
      <MDBRow>
        <MDBCol md="4" className="mt-3 mx-auto">
          <MDBJumbotron>
            <h1>
              <MDBIcon icon="cubes" className="green-text" /> Programmes
            </h1>
            <ul className="list-unstyled example-components-list">

              <MenuLink to="/components/badge" title="Computer Science (BSC/COM)" />
              <MenuLink to="/components/buttons" title="Information Systems (BSC/INF)" />
              <MenuLink to="/components/cards" title="Network (BSC/NET)" />

            </ul>
          </MDBJumbotron>
        </MDBCol>
      </MDBRow>
    </MDBContainer>
  );
}

export default ComponentsNavPage;
